// 产品接口
import request from '@/utils/request'; // 查询产品列表

export function getDTOs(query) {
  return request({
    url: '/ems/dtProduct',
    method: 'get',
    params: query
  });
} // 创建产品

export function postDTO(data) {
  return request({
    url: '/ems/dtProduct',
    method: 'post',
    data: data
  });
} // 查询单个产品

export function getDTO(routeCode) {
  return request({
    url: "/ems/dtProduct/".concat(routeCode),
    method: 'get'
  });
} // 更新产品

export function patchDTO(routeCode, data) {
  return request({
    url: "/ems/dtProduct/".concat(routeCode),
    method: 'patch',
    data: data
  });
} // 删除

export function deleteDTO(data) {
  return request({
    url: "/ems/dtProduct",
    method: 'delete',
    data: data
  });
}
